import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';
import { ShoppingCart, ArrowLeft, ShieldCheck } from 'lucide-react';

const ProductDetail = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [product, setProduct] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const getProduct = async () => {
      const { data, error } = await supabase
        .from('products')
        .then(res => res.from('products').select('*').eq('id', id).single());
      
      if (data) setProduct(data);
      setLoading(false);
    };
    getProduct();
  }, [id]);

  if (loading) return <div style={{ padding: '50px', textAlign: 'center' }}>Loading Gadget Details...</div>;
  if (!product) return <div style={{ padding: '50px', textAlign: 'center' }}>Product not found.</div>;

  return (
    <div style={pageContainer}>
      <button onClick={() => navigate(-1)} style={backBtn}><ArrowLeft size={18} /> Back to Shop</button>
      
      <div style={detailGrid}>
        {/* Product Image */}
        <div style={imageSection}>
          <img src={product.description || 'https://via.placeholder.com/400'} alt={product.name} style={mainImg} />
        </div>

        {/* Product Info */}
        <div style={infoSection}>
          <span style={categoryTag}>{product.category}</span>
          <h1 style={titleStyle}>{product.name}</h1>
          <p style={priceStyle}>RWF {product.price?.toLocaleString()}</p>
          
          <div style={featureBox}>
            <p><ShieldCheck size={16} color="#28a745" /> Official Warranty Included</p>
            <p><ShieldCheck size={16} color="#28a745" /> Delivery within Kigali: 24h</p>
          </div>

          <button style={cartBtn}>
            <ShoppingCart size={20} /> Add to Cart & Checkout
          </button>
        </div>
      </div>
    </div>
  );
};

// --- Styles ---
const pageContainer = { padding: '40px', maxWidth: '1100px', margin: '0 auto', fontFamily: 'sans-serif' };
const backBtn = { border: 'none', background: 'none', cursor: 'pointer', display: 'flex', alignItems: 'center', gap: '5px', color: '#666', marginBottom: '20px' };
const detailGrid = { display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '50px', backgroundColor: 'white', padding: '30px', borderRadius: '15px', boxShadow: '0 5px 15px rgba(0,0,0,0.05)' };
const mainImg = { width: '100%', borderRadius: '10px', objectFit: 'cover' };
const categoryTag = { color: '#008ECC', fontWeight: 'bold', fontSize: '14px', textTransform: 'uppercase' };
const titleStyle = { fontSize: '32px', margin: '10px 0' };
const priceStyle = { fontSize: '24px', fontWeight: 'bold', color: '#333', marginBottom: '20px' };
const featureBox = { borderTop: '1px solid #eee', borderBottom: '1px solid #eee', padding: '15px 0', margin: '20px 0', color: '#555', fontSize: '14px' };
const cartBtn = { width: '100%', padding: '15px', backgroundColor: '#008ECC', color: 'white', border: 'none', borderRadius: '8px', fontWeight: 'bold', fontSize: '16px', cursor: 'pointer', display: 'flex', justifyContent: 'center', alignItems: 'center', gap: '10px' };

export default ProductDetail;
